import React, { Component } from "react";

export default class SearchBar extends Component {
  render() {
    return (
      <form className="form-inline searchbar">
        <input
          className="form-control"
          type="search"
          placeholder="Search"
          aria-label="Search"
        />
        <button className="btn btn-outline-success" type="submit">
          Search
        </button>
      </form>
    );
  }
}
